import './Card.css';

const DeepTable = ({ e }) => {
  console.log(e);

  return (
    <th>
      <th>{e.position}</th>
      <tr>{e.team.name}</tr>
      <tr>{e.playedGames}</tr>
      <tr>{e.won}</tr>
      <tr>{e.draw}</tr>
      <tr>{e.lost}</tr>
      <tr>{e.goalsFor}</tr>
      <tr>{e.goalsAgainst}</tr>
      <tr>{e.goalDifference}</tr>
    </th>
  )
};

export default DeepTable;
